COMMENT ON COLUMN T_P_LISTENER.LISTENEREVEN IS '触发调用任务监听器的任务事件的类型
create：在任务被创建，且所有的任务属性被设置后发生。 
assignment：在任务分配给某人后发生。注意：当流程执行到 userTask，在触发 create 事件之前，首先触
发 assignment 事件。这像是一个反常的顺序，但原因很实际：接收到 create 事件，我们往往会要查看包括
代理人在内的所有任务的属性。 
complete：在任务完成后，任务从运行时的数据中被删除之前发生。';
COMMENT ON COLUMN T_P_LISTENER.LISTENERVALUE IS '监听器表达式或类名';
COMMENT ON COLUMN T_P_LISTENER.LISTENERNAME IS '监听器名称';
COMMENT ON COLUMN T_P_LISTENER.LISTENERSTATE IS '监听器状态
1：启用
